private String getRpcMetricSuffix() {
  if (serviceId == null && nnId == null) {
    return null;
  } else if (serviceId == null && nnId != null) {
    return nnId;
  } else if (serviceId != null && nnId == null) {
    return serviceId;
  } else {
    return serviceId + "-" + nnId;
  }
}
